    "fire-stations-2007",nt"isopen": false,nt"url": null,nt"notes": "Fire
    Station Locations in Kansas Any location where fire fighters are stationed at or
    based out of, or where equipment that such personnel use in carrying out their jobs
    is stored for ready use. Fire Departments not having a permanent location are included,
    in which case their location has been depicted at the city/town hall or at the center
    of their service area if a city/town hall does not exist. This dataset includes
    those locations primarily engaged in forest or grasslands fire fighting, including
    fire lookout towers if the towers are in current use for fire protection purposes.
    This dataset includes both private and governmental entities. Fire fighting training
    academies are also included. TGS verified the name, physical street address, city,
    state, five digit zip code, phone number, and location through phone contact. No
    other state provided information was verified. Text fields in this dataset have
    been set to all upper case to facilitate consistent database engine search results.
    All diacritics (e.g. the German umlaut or the Spanish tilde) have been replaced
    with their closest equivalent English character to facilitate use with database
    systems that may not support diacritics. The currentness of this dataset is indicated
    by the [CONTDATE] attribute. Based upon this attribute, the oldest record dates
    from 10/16/2006 and the newest record dates from 11/10/2006.",nt"license_title":
